  JDAVIES, Marianne Caroline and BUSBY, William
  JBUSBY, George Alexander and WATERHOUSE, Dorothy Blanche
  JBUSBY, Judith Margaret and SINCLAIR, Robin Brignall
  JSINCLAIR, Bridget and ADAMS, Donald Wilson
  02> ADAMS, Joshua Donald Busby
  b 09.07.1973
  Joshua b. at Masterton. He was educated at Hadlow Prep School, Rathkeale and Wairarapa College.
  He graduated MSc from Massey University in 1997 and is a geologist.
  03> ADAMS, Richard Donald
  b 18.09.1977
  Richard b, at Masterton. He was educated at Hadlow Prep School, Rathkeale and Wairarapa College
  and is a manager in retail.
  > SINCLAIR, Donald Richard m on 01.05.1971 to CLELAND, Lindsay
  b 27.09.1949
  b ** ** ****
  Donald b. at Gisborne and m. at New Plymouth. Divorced. Lindsay, dlo Duncan Cleland. Address: 34
  Cutfield Road, New Plymouth.
  Donald was educated at Waipawa Primary and Dannevirke High School. He obtained a Diploma in
  Industrial Design at the Wellington Polytech. He is now Manager of Taranaki Trust Bank Real Estate.
  He is also a keen yachtsman.
  01> SINCLAIR, Deborah Jane
  b 20.04.1974
  Address: 11/259 The Terrace, Wellington.
  Deborah was educated at New Plymouth Girls High School and was an American Field Scholar to
  Germany for three months, She graduated BCom from Victoria University.
  03> SINCLAIR, Victoria Ray m on 14.11.1987 to GROSSE, Frederick
  b 03.04.1951
  b 22.05.1936
  Victoria b. at Gisborne and m. at Phoenix, Arizona, USA. Frederick, s/o Patrick and Ruth Grosse, b.
  at New York, USA. Victoria was educated at Waipawa Primary, Dannevirke High School and Massey
  University (BA). She worked with the International Labour Office in Geneva, the UNDP in Iran, the
  External Aid Division of the Ministry of Foreign Affairs in Wellington then headed the Ministry
  office in Auckland for 3 years. She is now a holistic healer with her own practice in Phoenix and
  became a Reiki Master in 1991. Frederick has a PhD and is a rabbi and psychotherapist. He works as
  a consultant with a number of New Zealand companies.
  06> 'BUSBY, Helen
  b 24.05.1883 d 16.04.1968
  Helen b. at Tokatoka, d. at Gisborne and bd, at Taruheru Cemetery, Gisborne,
  07> BUSBY, Eleanor Maud (Lena) m on 01.06.1915 to JEFFERD, Frederic Reader
  b 07.04.1885 d 16.11.1968
  b 04.07.1886 d 11.11.1970
  Eleanor b. at Edenham, Patangata, Hawkes Bay, m. at St Mary's Church, Tokomaru Bay, d. at Te Puia Springs
  Hospital and cremated at Hastings. Frederic b. at Egg Buckland, Devon, England, d. at Te Puia Springs
  Hospital and cremated at Hastings.
  Lena was educated at Woodford House, Havelock North.
  Frederic came to New Zealand on the SS Devon arriving in New Zealand in Dec 1908. He farmed "Parenga"
  station, Tokomaru Bay. He served in the artillery in WW1.
